/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import Nav from "../components/Nav";
import dune from "../images/dune.jpg";
import React from "react";
import "./home.scss";

const HomeBackground = styled.div`
  background: url(${dune}) no-repeat center center fixed;
  background-size: cover;
  font-size: 24px;
  color: white;
  font-weight: bold;
`;

const HomeDiv = styled.div`
  border-style: solid;
  border-width: 3px;
  border-color: #aeff00;
  top: -50px;
  margin: 0px 50px;
`;

function Home() {
  return (
    <HomeBackground>
      <HomeDiv>
      <Nav />
      <h1>Home</h1>
      <p>Home</p>
      </HomeDiv>
    </HomeBackground>
  );
}

export default Home;
